### Summary of Core Topics, Concepts, Principles, and Equations

The exam focuses on several key areas in English language and grammar. Here is a summary of the core topics, concepts, and principles:

#### 1. **Discourse Markers**
- **Concept**: Words or phrases that connect ideas and structure the flow of text.
- **Examples**: "As a matter of fact," "Furthermore," "Truly," "However," "Unless."

#### 2. **Reading Comprehension**
- **Concept**: Understanding and interpreting written text.
- **Principles**: Identifying the main idea, supporting details, and the author's purpose.
- **Example**: Analyzing a paragraph about manual scavenging to answer questions on relevance, dependent clauses, and argument structure.

#### 3. **Figures of Speech**
- **Concept**: Literary devices used to create special effects or meanings.
- **Examples**:
  - **Pun**: "Ask for me tomorrow and you shall find me a grave man."
  - **Simile**: "Blind as a bat."
  - **Personification**: "The city never sleeps."
  - **Oxymoron**: "Pretty ugly."

#### 4. **Verb Tenses and Moods**
- **Concept**: Different forms of verbs to indicate time and mood.
- **Examples**:
  - **Future Perfect Tense**: "The Capisi home will have sat on the edge of the low-rent section..."
  - **Subjunctive Mood**: "If I were the Prime Minister, I would ensure equality for all."
  - **Present Continuous Tense**: "She is ruling this land."

#### 5. **Sentence Structure and Types**
- **Concept**: Understanding different types of sentences and their structures.
- **Examples**:
  - **Complex Sentence**: "The children who ran fast will have the best chance to return before breakfast."
  - **Simple Sentence**: "Day after tomorrow is a holiday."
  - **Compound Sentence**: "He was feeling mighty thirsty, so we went to the bar."

#### 6. **Adverbs and Adjectives**
- **Concept**: Words that modify verbs, adjectives, and other adverbs (adverbs), and words that describe nouns (adjectives).
- **Examples**:
  - **Adverb of Manner**: "well" in "I slept well."
  - **Adjective**: "sick" and "intensive" in "A sick Sharmila had to be provided intensive care."

#### 7. **Conjunctions and Clauses**
- **Concept**: Words that connect clauses or sentences and the clauses themselves.
- **Examples**:
  - **Coordinating Conjunction**: "so" in "He was feeling mighty thirsty, so we went to the bar."
  - **Adverbial Clause of Time**: "since he was a baby" in "They had called him the Runt since he was a baby."

#### 8. **Grammar and Syntax**
- **Concept**: Correct usage of grammar and sentence structure.
- **Examples**:
  - **Correct Sentence**: "They were a rather hopeful bunch."
  - **Erroneous Part**: "drive car" in "Rohan drive car fastly on highways."

#### 9. **Active and Passive Voice**
- **Concept**: Changing the subject of a sentence from the doer to the receiver of the action.
- **Example**: "Sajal takes the medal" changes to "The medal is taken by Sajal."

#### 10. **Logical/Semantic Roles**
- **Concept**: Identifying the role of phrases in a sentence.
- **Example**: "with a new knife" is an **Instrument** in "Sethu cut the bread with a new knife."

